import React from "react";

const RoboCard = () => {

	const singlecard = () => {
			robots.map((user, i) => {
				<div className="dib bg-light-green ma2 grow br3 pa4 bw2 shadow-5">
					<img alt="robots" src="https://robohash.org/1" />
					<h2>{robots[i].name}</h2>
					<p>{robots[i].email}</p>
				</div>
			}
		)
	}

	return(
		<singlecard />
	)
};

export default RoboCard;
